export function randomElfName(gender) {
  return `${random.element(NPC_NAMES_BY_RACE.elf[gender])} ${random.element(
    NPC_NAMES_BY_RACE.elf.surname1
  )}${random.element(NPC_NAMES_BY_RACE.elf.surname2)}`;
}

export function randomDragonbornName() {
  return random.element(NPC_NAMES_BY_RACE.dragonborn);
}

export function randomDwarfName(gender) {
  return `${random.element(
    NPC_NAMES_BY_RACE.dwarf[gender + '1']
  )}${random.element(NPC_NAMES_BY_RACE.dwarf[gender + '2'])}${random.element(
    NPC_NAMES_BY_RACE.dwarf[gender + '3']
  )} ${random.element(NPC_NAMES_BY_RACE.dwarf.surname1)}${random.element(
    NPC_NAMES_BY_RACE.dwarf.surname2
  )}`;
}

function gnome(i) {
  const combos = NPC_NAMES_BY_RACE.gnome;
  return random.element(combos[i]);
}

export function randomGnomeName(gender) {
  /* prettier-ignore */
  const surname = random.split([
    [50, gnome(8) + gnome(2) + gnome(9) + gnome(2) + gnome(10)],
    [20, gnome(8) + gnome(2) + gnome(9) + gnome(2) + gnome(13) + gnome(12) + gnome(10)],
    [30, gnome(8) + gnome(2) + gnome(13) + gnome(2) + gnome(9) + gnome(2) + gnome(10)],
  ]);
  /* prettier-ignore */
  const name = gender === 'Male'
    ? random.split([
      [50, gnome(1) + gnome(2) + gnome(3) + gnome(2) + gnome(4)],
      [20, gnome(1) + gnome(2) + gnome(3) + gnome(2) + gnome(11) + gnome(2) + gnome(4)],
      [30, gnome(1) + gnome(2) + gnome(11) + gnome(2) + gnome(3) + gnome(2) + gnome(4)],
    ])
    : random.split([
      [50, gnome(5) + gnome(2) + gnome(6) + gnome(2) + gnome(7)],
      [20, gnome(5) + gnome(2) + gnome(6) + gnome(2) + gnome(12) + gnome(2) + gnome(7)],
      [30, gnome(5) + gnome(2) + gnome(12) + gnome(2) + gnome(6) + gnome(2) + gnome(7)],
    ]);

  return name + ' ' + surname;
}

export function randomOrcName(gender) {
  return random.element(NPC_NAMES_BY_RACE.orc[gender]);
}

export function randomHalflingName(gender) {
  return (
    random.element(NPC_NAMES_BY_RACE.halfling[gender]) +
    ' ' +
    random.element(NPC_NAMES_BY_RACE.halfling.surname)
  );
}

export function randomHumanName(gender) {
  return random.element(NPC_NAMES_BY_RACE.human[gender]);
}

export function randomHumanSurname() {
  const part1 = random.element(NPC_NAMES_BY_RACE.human.surname1);
  const part2 = random.element(NPC_NAMES_BY_RACE.human.surname2);

  if (part1.toLowerCase() === part2.toLowerCase()) return part1;
  return random.element([
    part1 + part2,
    random.element(NPC_NAMES_BY_RACE.human.surname),
  ]);
}
